export default function Dashboard() {

const vari = 10; // connect to API
const username = "Mudit"; // connect to API
const email = "faizarali@corona.com"; // connect to API

  return (
    <div class="topnav">
      <Tabs  onSelect={(index, label) => console.log(label + ' selected')}>
