            <p><b>Email:</b> {email}</p>
            <p><b>Password:</b> ******** <button class="password_reset_button">Reset Password</button></p>
            <p><b>Card Count:</b> {vari}</p>
          </div>



        </Tab>
        <Tab  label="About">
        </Tab>
        <Tab  label="Logout"> </Tab>
      </Tabs>

    </div>

  );
}
